def Check_elements(str,labname):
	for a in labname:
		if a not in str:
			return False
#Check every character in the abbreviation of labname
#Return false as long as one character in labname is not found on the string(full labname)

def Find_labname(lab):
	name_list_1 = [] 
	#Create an empty name_list for recording satisfactory lab full names
	
	lab = lab.upper() 
	#Change abbreviate of lab_names all to capital letters
	
	first_letter = lab[0] 
	#Find the first letter of the abbreviate of the name
	
	for sublists in (eval("Lab_" + first_letter)): 
		#Specifically look for the list whose elements have the same starting letter as the abbreviate to reduce seraching time
		sublists = str(sublists.upper())
		lab_list = list(lab)
		if Check_elements(sublists,lab_list) != False:
			if sublists in name_list_1:
				continue
			else:
				name_list_1.append(sublists)
	#Check every element in the full labname list and add those which have common characters as the abbreviation to the new list
	return name_list_1

